function deepFreeze(array) {
    // 冻结当前数组
    Object.freeze(array);

    // 递归冻结数组的每个元素
    array.forEach((item) => {
        if (Array.isArray(item)) {
            deepFreeze(item); // 递归冻结子数组
        }
        // 冻结子数组的每个元素
        Object.freeze(item);
    });

    return array;
}


